const Render = ({coinImg, coinName, coinSymbol, coinPrice, coinVolume}) => {

    return (
        <div className='cointainer'>
            <div className='row'>
                <div className='item'>
                    <img src={coinImg} alt='image of crypto'/>
                    <h2>{coinName}</h2>
                    <p className='coin-symbol'>{coinSymbol}</p>
                </div>
                <div className='coin-data'>
                    <p className='coin-price'>${coinPrice}</p>
                    <p className='coin-volume'>${coinVolume.toLocalString()}</p>

                </div>
            </div>
        </div>
    );
}

export default Render;
